    - type: Paper
      content: >-
        ОНИ СЛЕДЯТ, СЛЕДЯТ, Я ЧУВСТВУЮ ИХ, ОНИ ВЕЗДЕ, ВЕЗДЕ, ОНИ НАБЛЮДАЮТ. Я ЧУВСТВУЮ ИХ ШЕПОТ, Я СЛЫШУ ИХ ШЕПОТ, ОНИ ГОВОРЯТ ШЕПОТОМ, СЛЫШУ ШЕПОТ СТОНЫ СТОНЫ. Неделю назад мы с Дмитрием ходили в рейд, всё шло хорошо, но когда мы вернулись, ОН БЫЛ ДРУГИМ, ОН СТАЛ ДРУГИМ, Я ВИЖУ, Я ЗНАЮ, ЭТО НЕ ОН. ЕГО ПОДМЕНИЛИ, ПОДМЕНИЛИ, ЭТО ТОЧНО НЕ ОН, ЭТО НЕ ОН, ЭТО НЕ ДИМА, ЭТО НЕ ОН. ЭТИ МЕРЗКИЕ ИЗ КОЛБ ПОДМЕНИЛИ ЕГО, ЭТИ МЕРЗКИЕ ИЗ ТЕМНОТЫ, С НИМ ЧТО-ТО НЕ ТАК, ОН СОВСЕМ ДРУГОЙ.


        Яйцеголовый, этот врач, говорит, что у меня паранойя, что меня, скорее всего, облучили, НО ОН ПРОСТО НЕ ПОНИМАЕТ, НИКТО НЕ ПОНИМАЕТ, ЧТО ОНИ ПОДМЕНИЛИ ЕГО. ОН СТАЛ ДРУГИМ, ОН СТАЛ ДРУГИМ, ОН ЕСТ СЛИШКОМ МНОГО, ОН СЛИШКОМ МЕДЛЕННЫЙ, ОН СМОТРИТ НА МЕНЯ ГЛАЗАМИ.


        Сегодня я пойду с Дмитрием на вылазку, я должен, я ДОЛЖЕН ИХ НАЙТИ. НАЙТИ. Я ДОЛЖЕН ОТОМСТИТЬ. ОТОМСТИТЬ. УБИТЬ ИХ ВСЕХ. ЗАБРАТЬ. СВЕСТИ СЧЁТЫ. РАЗОБРАТЬСЯ С НИМИ. СТЕРЕТЬ.


        Дальше текст становится практически нечитаемым, буквы пляшут, слова переплетаются, видны неразборчивые каракули и пометки, как будто автор пытался что-то зачеркнуть или подчеркнуть.


        Дим… Димчик… ПРОСТИ… Я НЕ СМОГ… НЕ СМОГ… НЕ УСЛЕДИЛ… Я НЕ УСЛЕДИЛ, ЧТО ОНИ ЕГО ЗАБРАЛИ. ТЕБЯ БОЛЬШЕ НЕТ, ТЕПЕРЬ УЖЕ НЕТ. ТЫ ПРЕВРАТИЛСЯ. Я ОТОМЩУ ЗА ТЕБЯ… Я ОТОМЩУ… ЗА ТЕБЯ… Я ОТОМЩУ. Я УБЬЮ ИХ ВСЕХ. Я ДОЛЖЕН, Я ДОЛЖЕН ОТОМСТИТЬ. Я УБЬЮ ИХ ВСЕХ, Я УБЬЮ… УБЬЮ-УБЬЮ-УБЬЮ…


